import "./ReadModal.scss";

const ReadModal = (props) => {
    return(
        <div className="modal">
            <div className="modalOverlay"></div>
            <div className="modalContent">
                <div className="closeBtn">
                    <svg aria-label="닫기" class="_8-yf5 " color="#ffffff" fill="#ffffff" height="24" role="img" viewBox="0 0 24 24" width="24"><polyline fill="none" points="20.643 3.357 12 12 3.353 20.647" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="3"></polyline><line fill="none" stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="3" x1="20.649" x2="3.354" y1="20.649" y2="3.354"></line></svg>
                </div>
                <div className="readWrap">
                    <div className="readImg"></div>
                    <div className="readContent"></div>
                </div>
            </div>
        </div>
    );
};

export default ReadModal;
